// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Ex6_9 {


event Information(string info);
enum FoodProcess {
order,
takeAway,
delivery,
payment
}
FoodProcess public foodStatus;
constructor(){
foodStatus = FoodProcess.payment;
}

modifier onlyStatus(FoodProcess _expected) {
        require(foodStatus == _expected, "Invalid food process status");
        _;
    }
 function orderFood() public onlyStatus(FoodProcess.payment) {
        foodStatus = FoodProcess.order;
        emit Information("Order success");
    }

    function takeAwayFood() public onlyStatus(FoodProcess.order) {
        foodStatus = FoodProcess.takeAway;
        emit Information("takeAway success");
    }

    function deliveryFood() public onlyStatus(FoodProcess.takeAway) {
        foodStatus = FoodProcess.delivery;
        emit Information("delivery success");
    }

    function paymentFood() public onlyStatus(FoodProcess.delivery) {
        foodStatus = FoodProcess.payment;
        emit Information("payment success");
    }
}

